import React from 'react';
import Card from './Card';

const Cardlist = ({props}) => {
	return (
		<div>
			{robotMap = props.map ((user, i) => {
				return (
						<Card id={user[i].id} name={user[i].name} email={user[i].email}/>
				);
					})
			}
		</div>
	);
}

export default Cardlist;
